        height: $row_max_height;
        padding: .5rem 3rem;
        font: 400 1.8rem $font-noto;
        border: none;
        border-radius: 1rem;
    }

    &-venue-city {
        grid-column: 1/2;
    }

    &-state-city {
        grid-column: 2/3;
    }

    &-message {
        height: 20rem;
        padding-top: 2rem;
        resize: none;
    }
}


@media(max-width: $medium-width) {
    .get-in-touch__form {
    
        &-venue-city {
            grid-column: 1/3;
        }
    
        &-state-city {
            grid-column: 1/3;
        }
    
    }
}

